//squares between the king &&  king-side their.includes(rook) starting positions 

export const kingSideCastlePaths = {
    'W': ["g1", "f1"],
    'B': ["g8", "f8"]
}
Object.preventExtensions(kingSideCastlePaths);
Object.seal(kingSideCastlePaths);
Object.freeze(kingSideCastlePaths);
// module.exports = kingSideCastlePaths;
